import React, { useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import { getPlatformScores } from "../api/productApi";
import { BarChart, Bar, XAxis, YAxis, Tooltip, ResponsiveContainer, RadialBarChart, RadialBar } from "recharts";

const ProductDetail = () => {
  const { id } = useParams();
  const [platformData, setPlatformData] = useState([]);

  useEffect(() => {
    async function fetchPlatformScores() {
      try {
        const data = await getPlatformScores(id);
        setPlatformData(data);
      } catch (error) {
        console.error("Platform skorları yüklenirken hata oluştu.");
      }
    }
    fetchPlatformScores();
  }, [id]);

  return (
    <div className="container mt-4">
      <h1 className="text-center mb-5">Ürün Detayı - ID: {id}</h1>

      <div className="row">
        {platformData.length > 0 ? (
          platformData.map((platform, index) => (
<div key={index} className="col-md-4 mb-4">
  <div 
    className="card h-100 shadow-sm border-0"
    style={{
      borderRadius: "20px",
      background: "linear-gradient(135deg, #f8f9fa 0%, #e9ecef 100%)",
      transition: "transform 0.3s ease, box-shadow 0.3s ease",
      cursor: "pointer"
    }}
    onMouseEnter={e => {
      e.currentTarget.style.transform = "scale(1.03)";
      e.currentTarget.style.boxShadow = "0 8px 20px rgba(0, 0, 0, 0.2)";
    }}
    onMouseLeave={e => {
      e.currentTarget.style.transform = "scale(1)";
      e.currentTarget.style.boxShadow = "0 4px 12px rgba(0, 0, 0, 0.1)";
    }}
  >
    <div className="card-body text-center">
      <h4 className="card-title mb-4">{platform.platform}</h4>

      {/* Memnuniyet Grafiği */}
      <div style={{ width: "100%", height: 200, marginBottom: "20px" }}>
        <ResponsiveContainer>
          <RadialBarChart
            cx="50%"
            cy="50%"
            innerRadius="60%"
            outerRadius="90%"
            barSize={15}
            data={[
              { name: "Memnuniyet", value: platform.memnuniyet, fill: "#00C49F" }
            ]}
            startAngle={90}
            endAngle={-270}
          >
            <RadialBar minAngle={15} background clockWise dataKey="value" />
            <text
              x="50%"
              y="50%"
              textAnchor="middle"
              dominantBaseline="middle"
              style={{ fontSize: 22 }}
            >
              {platform.memnuniyet}%
            </text>
          </RadialBarChart>
        </ResponsiveContainer>
      </div>

      {/* Küçük Bar Grafikler */}
      <div style={{ width: "100%", height: 150 }}>
        <ResponsiveContainer>
          <BarChart
            layout="vertical"
            data={[
              { name: "Kalite", puan: platform.kalite },
              { name: "Fiyat/Performans", puan: platform.fiyatPerformans },
              { name: "Kargolama", puan: platform.kargolama },
            ]}
            margin={{ top: 20, right: 30, left: 20, bottom: 5 }}
          >
            <XAxis type="number" domain={[0, 100]} hide />
            <YAxis type="category" dataKey="name" />
            <Tooltip />
            <Bar dataKey="puan" fill="#007bff" />
          </BarChart>
        </ResponsiveContainer>
      </div>

    </div>
  </div>
</div>

          ))
        ) : (
          <p className="text-center">Platform verisi bulunamadı.</p>
        )}
      </div>
    </div>
  );
};

export default ProductDetail;
